uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters from JSON
uniform float u_speed;
uniform float u_complexity;
uniform float u_warp;
uniform float u_glow;
uniform float u_color_shift;
uniform float u_grid_opacity;
uniform float u_zoom;

out vec4 fragColor;

// --- Helper Functions ---

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 2D Noise function
float hash(vec2 p) {
    p = fract(p * vec2(123.34, 456.21));
    p += dot(p, p + 45.32);
    return fract(p.x * p.y);
}

float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    float a = hash(i);
    float b = hash(i + vec2(1.0, 0.0));
    float c = hash(i + vec2(0.0, 1.0));
    float d = hash(i + vec2(1.0, 1.0));
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(a, b, u.x) + (c - a) * u.y * (1.0 - u.x) + (d - b) * u.x * u.y;
}

// Fractal Brownian Motion (Ridged)
float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    float shift = 100.0;
    for (int i = 0; i < 6; ++i) {
        if(float(i) >= u_complexity) break;
        // Ridged noise: abs(noise) creates the "veins"
        v += a * abs(noise(p));
        p = rot(0.5) * p * 2.0 + shift;
        a *= 0.5;
    }
    return v;
}

// Background Grid
float getGrid(vec2 uv) {
    vec2 g = fract(uv * 15.0);
    vec2 l = smoothstep(0.97, 1.0, g);
    return max(l.x, l.y) * u_grid_opacity;
}

void main() {
    // 1. Correct Aspect Ratio & Centering
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 raw_uv = uv;

    // 2. Initial symmetry (Neural X-shape)
    uv *= u_zoom;
    uv = abs(uv); 
    uv *= rot(0.7853); // 45 degree tilt for the X-cross

    float t = iTime * u_speed;

    // 3. Recursive Domain Warping
    // We warp the coordinates for the noise using noise itself
    vec2 q = vec2(0.0);
    q.x = fbm(uv + vec2(0.0, t * 0.2));
    q.y = fbm(uv + vec2(1.0, t * 0.3));

    vec2 r = vec2(0.0);
    r.x = fbm(uv + 1.0 * q + vec2(1.7, 9.2) + 0.15 * t);
    r.y = fbm(uv + 1.0 * q + vec2(8.3, 2.8) + 0.126 * t);

    // Final composite noise value
    float f = fbm(uv + u_warp * r);

    // 4. Color Palette Logic
    // Deep Blue base
    vec3 col_deep = vec3(0.02, 0.05, 0.15);
    // Electric Cyan
    vec3 col_mid = vec3(0.0, 0.8, 1.0) + u_color_shift;
    // Fiery Orange/Gold
    vec3 col_high = vec3(1.0, 0.6, 0.1);
    // Pure peak
    vec3 col_peak = vec3(1.0, 0.95, 0.8);

    // 5. Coloring the flux
    vec3 color = col_deep;

    // Add blue wispy turbulent flows
    float flow = smoothstep(0.2, 0.8, f);
    color = mix(color, col_mid, flow * 0.6);

    // Add the "Neural Filaments" (high intensity peaks)
    // Using pow() to sharpen the ridges
    float filament = pow(f, 4.0) * u_glow;
    color = mix(color, col_high, clamp(filament, 0.0, 1.0));

    // Add white-hot cores to the filaments
    float core = pow(f, 9.0) * (u_glow * 2.0);
    color += col_peak * core;

    // 6. Layered Effects
    // Background Grid
    float grid = getGrid(raw_uv + q * 0.1);
    color += grid * (1.0 - flow);

    // Subtle film grain
    float grain = (hash(raw_uv + iTime) - 0.5) * 0.04;
    color += grain;

    // Radial Vignette
    float vignette = smoothstep(1.2, 0.2, length(raw_uv));
    color *= vignette;

    // Final Post-Exposure
    color = pow(color, vec3(0.95)); // Slight gamma adjustment

    fragColor = vec4(color, 1.0);
}
